window.bookSummaryJSON = "<p><b>It was called Jade Dragon…and it threatened to destroy the West. </b></p> <p>Was an attack on the US imminent? </p> <p>In a lab deep in the heart of China, a brilliant engineer had a breakthrough. It was the most powerful AI ever created. Ma Young believed the Jade Dragon could combat the world’s most dire challenges. There was just one problem...the president of China had other ideas. Was this their chance to conquer? </p> <p>The war began at the speed of light. The entire NATO alliance stood on the brink of destruction. Cyber attacks, deepfakes, and a wave of social media disinformation wrought fear and desperation across the globe. The sleeping giant was awake. Could Ma stop his creation?</p>"; 
